(function () {
  'use strict';

  const id = decodeURIComponent('example');const name = decodeURIComponent('%E7%A4%BA%E4%BE%8B%E6%8F%92%E4%BB%B6');const version = decodeURIComponent('4');

  function runOnce(fn) {
    const uniqId = 'BEXT_UNIQ_ID_' + id;
    if (window[uniqId]) {
      return;
    }
    window[uniqId] = true;
    fn && fn();
  }

  runOnce(() => {
      console.log('这里保证仅执行一次');
      console.log(`取到脚本名称：${name}，ID：${id}，版本：${version}`);
  });

})();
